import React, { useEffect, useState } from "react";
import "./News.scss";

const News = ({ category }) => {
  const [mynews, setMyNews] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [currentPage, setCurrentPage] = useState(1);
  const recordsPerPage = 6;

  const fetchData = async () => {
    setLoading(true);
    setError(null);

    try {
      let response = await fetch(
        `https://newsapi.org/v2/top-headlines?country=us&category=${category}&apiKey=e8bcb5454d444bdbba06ed45e8c8a3cb`
      );

      if (!response.ok) {
        throw new Error("Failed to fetch data");
      }

      const data = await response.json();
      setMyNews(data.articles);
    } catch (error) {
      setError(error.message);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchData();
  }, [category]);

  const lastIndex = currentPage * recordsPerPage;
  const firstIndex = lastIndex - recordsPerPage;
  const records = mynews.slice(firstIndex, lastIndex);
  const nPage = Math.ceil(mynews.length / recordsPerPage);
  const numbers = [...Array(nPage + 1).keys()].slice(1);

  const prePage = () => {
    if (currentPage !== 1) {
      setCurrentPage(currentPage - 1);
    }
  };

  const nextPage = () => {
    if (currentPage !== nPage) {
      setCurrentPage(currentPage + 1);
    }
  };

  const changeCPage = (id) => {
    setCurrentPage(id);
  };

  return (
    <>
      <h1 className="text-center my-3">
        Latest <span className="badge bg-danger">News</span>
      </h1>
      {loading ? (
        <div className="text-center">Loading...</div>
      ) : error ? (
        <div className="text-center text-danger">{error}</div>
      ) : (
        <div className="mainDiv">
          <div className="main">
            {records.map((ele) => (
              <div className="card" key={ele.url}>
                <div className="container">
                  <img
                    src={ele.urlToImage || "placeholder.png"}
                    alt=""
                    onError={(e) => {
                      e.target.onerror = null;
                      e.target.src = "placeholder.png";
                    }}
                  />
                  <div className="overlay"></div>
                </div>
                <div className="card-content overlay">
                  <h2>{ele.author === "" ? "Janelle Ash" : ele.author}</h2>
                  <p>{ele.title}</p>
                  <a href={ele.url} className="button">
                    Find out more
                    <span className="material-symbols-outlined">{"->"}</span>
                  </a>
                </div>
              </div>
            ))}
          </div>
          <div className="center">
            <ul className="pagination">
              <li className="page-item">
                <button
                  className="page-link"
                  disabled={currentPage === 1}
                  onClick={prePage}
                >
                  Prev
                </button>
              </li>
              {numbers.map((n) => (
                <li
                  className={`page-item ${currentPage === n ? "active" : ""}`}
                  key={n}
                >
                  <button
                    className="page-link"
                    onClick={() => changeCPage(n)}
                  >
                    {n}
                  </button>
                </li>
              ))}
              <li className="page-item">
                <button
                  className="page-link"
                  disabled={currentPage === nPage}
                  onClick={nextPage}
                >
                  Next
                </button>
              </li>
            </ul>
          </div>
        </div>
      )}
    </>
  );
};

export default News;
